function Home() {
    return (
        <div className="container-home">
            <div className="logo">
                <img src="/logo.png" alt="Sujeito Link Logo" />
                <h1>Sujeito Link</h1>
                <span>Cole seu Link para encurtar</span>
            </div>
        </div>
    );
}

export default Home;
